import React from "react";
import { useState } from "react";

const handleSubmit = (e) => {
  e.preventDefault();
};

const Square = () => {
  const [value, setValue] = useState(3);
  return (
    <div>
      <form onSubmit="">
        <input
          name="number"
          type="text"
          placeholder={value}
          onChange={(e) => handleSubmit(e.target.value)}
          className="forms2"
        />
      </form>
    </div>
  );
};

export default Square;
